<template>
    <Modal v-model="video_call_modal_show" class="sdk-modal sdk-video-modal sdk-video-call-modal" title="视频通话" scrollable
           :width=modal_width :z-index="5000" :mask="false" v-on:on-cancel="on_hide_modal" v-on:on-visible-change="on_visible_change">
        <div slot="header">
            <div class="ivu-modal-header-inner">
                <span>视频通话</span>
                <span v-show="!show_max">-</span>
                <span v-show="!show_max">{{uname}}</span>
                <Icon v-show="show_max" @click="toggleMax" type="md-remove" color="#fff" class="sdk-toggle-max"/>
                <Icon v-show="!show_max" @click="toggleMax" type="md-add" color="#fff" class="sdk-toggle-max"/>
            </div>
        </div>
        <div v-show="show_max" class="sdk-panel" style="min-height: 480px;"> <!-- min-height: 640px; 420-->
            <div v-show="call_status==1" style="position: absolute;left: 0px;text-align: left;margin: 5px;">
                <Avatar class="ivu-avatar sdk-avatar-medium" :src="res_avatar1"/>
                <div style="display: inline-block;vertical-align: middle;">
                    <div class="sdk-uname">{{uname}}</div>
                    <div>正在等待对方接受邀请...</div>
                </div>
            </div>
            <div class="sdk-canvas-local-dom">
                <canvas :id=sdk_canvas_local_dom style="width:100%;height:100%;"></canvas>
            </div>
            <div v-show="call_status==2" class="sdk-canvas-remote-dom">
                <canvas :id=sdk_canvas_remote_dom style="width:100%;height:100%;"></canvas>
            </div>
            <audio id="sdk_call_ring" loop="true" preload="auto" :src="res_ring" type="audio/mpeg"></audio>
        </div>
        <div slot="footer" class="sdk-tac">
            <Icon v-show="mute&&call_status==2" @click="switchMute" type="md-volume-off" size="24"
                  style="cursor: pointer;position: absolute;left: 30px;line-height: 47px;" title="点击打开声音"/>
            <Icon v-show="!mute&&call_status==2" @click="switchMute" type="md-volume-up" size="24"
                  style="cursor: pointer;position: absolute;left: 30px;line-height: 47px;" title="点击关闭声音"/>
            <!--<div v-show="show_volume" class="sdk-volume-bar">
                <Slider v-model="volume"></Slider>
            </div>
            <Button shape="circle" class="sdk-call-btn" @click="toggleVolume">
                <Icon type="md-volume-up" color="#000" class="btn"/>
            </Button>-->
            <Button @click="cancelCall" shape="circle" class="sdk-call-btn">
                <Icon type="ios-call" color="#E62019" class="sdk-btn sdk-call"/>
            </Button>
            <!--<span style="position: absolute;right: 30px;line-height: 47px;">00:01</span>-->
            <span style="position: absolute;right: 30px;line-height: 47px;" v-show="call_status==2">{{call_time}}</span>
            <!--<Button @click="mockCall" shape="circle" class="call_btn">
                <Icon type="ios-call" color="green" class="btn call"/>
            </Button>-->
        </div>
    </Modal>
</template>

<script>
    import moment from 'moment';
    import logger from "../../tools/logger";
    import config from "../../tools/config";
    import {mapActions, mapState, mapGetters} from 'vuex'; //注册 action 和 state
    import res_ring from '../assets/audio/ring.wav';
    import res_avatar1 from '../assets/img/avatar1.png';
    import VideoProcessor from "../../tools/video/videoProcessor";
    import bus from '../bus';
    import $ from 'jquery';
    import 'jquery-ui/ui/widgets/draggable';

    /**
     * <audio autoplay controls src="data:audio/wav;base64,">
     The “audio” tag is not supported by your browser.
     </audio>
     */

    export default {
        name: 'VideoCallModal',
        components: {},
        data() {
            //return store.state
            return {
                res_ring: res_ring,
                res_avatar1: res_avatar1,
                show_volume: false,
                show_max: true,
                volume: 25,
                //uname: 'ertestuser',
                modal_width: 724,// 380 config.video_canvas_default_h,// 一般默认是竖屏，使用高度 old:380
                //call_status: 0, // 0:not_call, 1:call_ing, 2:call_success
                call_time: '00:00',
                call_time_num: 0,
                call_ts_id: null,
                //uname: this.username
                sdk_canvas_local_dom: 'sdk_vcall_canvas_local',
                sdk_canvas_remote_dom: 'sdk_vcall_canvas_remote',
                ws_local: null,
                ws_remote: null,
                call_established: false,
                mute: false
            }
        },
        props: {
            /*value: {
                type: Boolean,
                default: false
            },*/
            //username: String
            uname: {
                type: String,
                default: ''
            },
            target: {
                type: Number,
                default: 0
            },
            status: {
                type: Number,
                default: 0
            }
        },
        /*created: function () {
            this.call_status = this.status;
        },*/
        mounted: function () {
            let that = this;

          $('.sdk-video-call-modal .ivu-modal').draggable();

            //let root = that.$root;
            bus.$on('call-status-video-call', (rsp) => {
                if (rsp.call_type !== 1) {
                    return;
                }
                let demander = rsp.demander;
                let target = rsp.target;
                let status = rsp.status;
                let login_uid = window.websdk.private_cache.login_uid;
                if (login_uid != demander && login_uid != target) { // send call or receive call
                    logger.debug('video-call-modal ignore');
                    return;
                }

                // XXX 1:视频call
                if (status == 64) {
                    let is_con = that.video_call && that.video_call.is_con;
                    that.modal_width = is_con ? 1284 : 724;
                    logger.debug('video-call-modal ready');
                    // ready TODO 建立视频连接
                    if (target !== that.$store.state.video_call.target) {
                        return;
                    }
                    //let channel = rsp.channel;
                    let playid = rsp.playid;
                    if (playid) {
                        let url_local = config.build_video_url(0);
                        let url_remote = config.build_video_url(playid);
                        let canvas_local_dom = that.sdk_canvas_local_dom;
                        let canvas_remote_dom = that.sdk_canvas_remote_dom;
                        let vp1 = new VideoProcessor(url_local, canvas_local_dom, is_con);
                        //that.setVideoWS({id: that.id, ws: vp1.videoWebsocket});
                        that.ws_local = vp1.videoWebsocket;
                        let vp2 = new VideoProcessor(url_remote, canvas_remote_dom);
                        //that.setVideoWS({id: that.id, ws: vp2.videoWebsocket});
                        that.ws_remote = vp2.videoWebsocket;
                        that.$store.dispatch('updateVideoCallStatus', 2).then(null);
                        that.fresh_ui_call_status(2);
                        that.call_established = true;
                    }

                } else if (status == 66) {
                    //  66 – 对方振铃中/振铃
                    that.modal_width = (that.video_call && that.video_call.is_con) ? 1284 : 724;

                } else if (status == 67) {
                    // 67 – 对方已接受/接受
                    logger.debug('video-call-modal accepted');
                    /*if (target == that.$store.state.voice_call.target) {
                        that.$store.dispatch('updateVideoCallStatus', 2).then(null);
                        that.fresh_ui_call_status(2);
                    }*/

                } else if (status == 250) {
                    // 250- 对方结束通话
                    logger.debug('video-call-modal close');
                    that.on_hide_modal(true);
                    return;

                } else if (status == 253) {
                    // XXX 正在通话时再发起通话，只需要提示正在通话，不能fresh_ui_call_status
                    let vcall_ing = this.$store.state.video_call;
                    if (!that.call_established && (!vcall_ing.modal_show || vcall_ing.target == this.target)) {
                        that.on_hide_modal(true);
                    }
                    that.$Message.warning('当前正在进行视频通话，不能再次发起通话');
                } else {
                    logger.debug('video-call-modal other');
                    that.fresh_ui_call_status(0);
                    //that.$store.dispatch('updateVoiceCallStatus', 0).then(null);
                    that.hideVideoCallModal();
                    if (status == 68) {
                        that.$Message.warning('目标不可达');
                    } else if (status == 69) {
                        that.$Message.warning('目标忙');
                    } else if (status == 70) {
                        that.$Message.warning('目标无应答');
                    } else if (status == 250) {
                        that.$Message.warning('对方结束通话');
                    } else if (status == 251) {
                        that.$Message.warning('无法打开摄像头');
                    } else if (status == 252) {
                        that.$Message.warning('视频数已超限');
                    } else if (status == 253) {
                        that.$Message.warning('当前正在进行音视频通话，不能再次发起通话');
                    } else if (status == 254) {
                        that.$Message.warning('当前正在其他组分享视频');
                    } else if (status == 255) {
                        that.$Message.warning('未检测到麦克风');
                    }
                }
                /**
                 64 – ready(仅视频call 有效)
                 65 – PTT ON请求被降级为通话请求
                 66 – 对方振铃中/振铃
                 67 – 对方已接受/接受
                 68 – 目标不可达
                 69 – 目标忙
                 70 – 目标无应答
                 71 – 由于网络不好，系统自动结束通话
                 250- 对方结束通话
                 251 -无法打开摄像头（仅视频call有效）
                 252 – 视频数已超限
                 253 – 当前正在进行音视频通话，不能再次发起通话
                 **/
            });
        },
        destroyed: function () {
            //let that = this;
            //let root = that.$root;
            bus.$off('call-status-video-call');
        },
        methods: {
            toggleVolume() {
                this.show_volume = !this.show_volume;
            },
            toggleMax() {
                this.show_max = !this.show_max;
            },
            switchMute() {
                let that = this;
                that.mute = !that.mute;
                let mute_num = that.mute ? 1 : 0;
                // eslint-disable-next-line no-unused-vars
                window.websdk.request.videoRequest.videoMute(that.target, null, 0, 0, mute_num, function (rsp) {
                    //logger.debug('req_video_mute_video result:{}', rsp);
                }, 'req_video_mute_video_call');//

            },
            /*resetCallStatus() {
                document.getElementById('sdk_call_ring').load();
                this.call_ing = true;
                this.call_time = '00:01';
                if (this.call_ts_id) {
                    clearInterval(this.call_ts_id);
                    this.call_ts_id = null;
                }
            },*/
            callStop() {
                let that = this;
                let login_uid = window.websdk.private_cache.login_uid;
                //if (that.call_status == 1 || that.call_status == 2) {
                window.websdk.request.voiceRequest.call(login_uid, that.target, null, null, 1, 1, 0, 0, null, function (rsp) {
                    logger.debug('video_call_req_call_stop result:{}', rsp);
                }, 'video_call_req_call_stop');//
                //}
            },
            cancelCall() {
                this.on_hide_modal();
            },
            mockCall() {
                //this.resetCallStatus();
                //this.call_status = 2;
                this.$store.dispatch('updateVideoCallStatus', 2).then(null);
                this.fresh_ui_call_status(2);
            },
            mockConfirmCall() {
                //TODO
                //his.$store.dispatch('showVideoCallModal', null).then(null);

            },
            on_hide_modal(no_call_stop) {// XXX 当modal窗口发起$emit事件通知窗口关闭时，这里继续通知App.vue窗口已经关闭
                let that = this;
                if (!no_call_stop) {
                    that.callStop();
                }
                //this.resetCallStatus();
                that.call_established = false;
                that.fresh_ui_call_status(0);
                this.$emit('on-call-cancel');
                if (that.ws_local && that.ws_local.established) {
                    that.ws_local.destroy();
                    that.ws_local = null;
                }
                if (that.ws_remote && that.ws_remote.established) {
                    that.ws_remote.destroy();
                    that.ws_remote = null;
                }
                that.clear_canvas();
                that.video_call_modal_show = false;

            },

            clear_canvas() {
                let that = this;
                let canvas1 = document.getElementById(that.sdk_canvas_local_dom);
                let gl1 = canvas1.getContext("webgl") || canvas1.getContext("experimental-webgl");
                gl1 && gl1.clear(gl1.COLOR_BUFFER_BIT);

                let canvas2 = document.getElementById(that.sdk_canvas_remote_dom);
                let gl2 = canvas2.getContext("webgl") || canvas2.getContext("experimental-webgl");
                gl2 && gl2.clear(gl2.COLOR_BUFFER_BIT);
            },

            on_visible_change(result) {
                let that = this;
                if (result && that.status == 2) {
                    that.fresh_ui_call_status(2);
                    //on
                }
                if (!result) { //由于窗口不会重新创建，隐藏时重置状态
                    that.call_established = false;
                    that.mute = false;
                }

                let notice_data = {
                    cmd_status: 0,
                    cmd_type: 2,
                    msg_code: result ? 'notice_video_call_modal_open' : 'notice_video_call_modal_close',
                    target: that.target
                };
                window.websdk.listeners.monitors.notice_dynamic(notice_data);

                /*let that = this;
                let root = that.$root;
                let login_uid = window.websdk.private_cache.login_uid;
                if (result) {

                } else {
                    //that.callStop();
                    that.fresh_ui_call_status(0);
                    that.$emit('on-call-cancel');
                }*/
            },
            fresh_ui_call_status(val) {
                let that = this;
                that.call_status = val;
                that.call_time = '00:00';
                that.call_time_num = 0;
                that.call_time_base = moment().minutes(0).seconds(0);
                if (that.call_ts_id) {
                    clearInterval(that.call_ts_id);
                    that.call_ts_id = null;
                }
                document.getElementById('sdk_call_ring').load();
                if (!this.$store.state.video_call.modal_show) {
                    return;
                }

                if (val == 1) { // call ing
                    document.getElementById('sdk_call_ring').play();
                } else if (val == 2) { // call success
                    //document.getElementById('sdk_call_ring').load();
                    // TODO 开始计时
                    that.call_ts_id = setInterval(function () {
                        let duration = ++that.call_time_num;

                        let dur_m = Math.floor(duration / 60);
                        let dur_s = Math.ceil(duration % 60);
                        dur_m = dur_m >= 10 ? dur_m : '0' + dur_m;
                        dur_s = dur_s >= 10 ? dur_s : '0' + dur_s;
                        duration = dur_m + ':' + dur_s;

                        that.call_time = duration;
                        //that.call_time = that.call_time_base.add(1, 's').format('HH:mm:ss');
                        logger.debug('vi_call:{}', that.call_time);
                    }, 1000);
                } else {
                    //document.getElementById('sdk_call_ring').load();
                }
            },
            ...mapActions([
                'showVideoCallModal', 'hideVideoCallModal'
            ]),
            // 使用对象展开运算符将 getter 混入 computed 对象中
            ...mapGetters([
                // ...
            ])
        },
        computed: {
            video_call_modal_show: {
                get() {
                    return this.$store.state.video_call.modal_show;
                },
                set(value) {
                    if (value) {
                        this.$store.dispatch('showVideoCallModal', this.target).then(null);
                    } else {
                        this.$store.dispatch('hideVideoCallModal').then(null);
                    }
                }
            },
            call_status: {
                get() {
                    //return 'test';
                    return this.$store.state.video_call.status;
                },
                set(value) {
                    if (value) {
                        this.$store.dispatch('updateVideoCallStatus', value).then(null);
                    }
                }
            },

            // 使用对象展开运算符将此对象混入到外部对象中
            ...mapState([
                // 映射 this.video_call 为 store.state.video_call
                'video_call'
            ]),
        },
        /*watch: {
            call_status: function (val) {
                if (val == 1 && this.$store.state.video_call_modal_show) { // call ing
                    document.getElementById('sdk_call_ring').play();
                } else if (val == 2 && this.$store.state.video_call_modal_show) { // call success
                    document.getElementById('sdk_call_ring').load();
                    // TODO 开始计时
                    let that = this;
                    if (that.call_ts_id) {
                        clearInterval(that.call_ts_id);
                        that.call_ts_id = null;
                    }
                    that.call_ts_id = setInterval(function () {
                        that.call_time = new Date();
                    }, 1000);
                } else {
                    document.getElementById('sdk_call_ring').load();
                }
            },
        }*/
    }
</script>

